import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './textfields.css';
import {Link} from 'react-router-dom';
import Navigation from "../../Navigation/Navigation";
import FinalNav from "../../Navigation/FinalNav";

class RowEnquiry extends Component{
    constructor(props) {
        super(props);
        this.state =
            {
                UsernameChange : "",
                passwordChange : "",
                name: 'Surya',
                BlockChange : "",
                InverterChange : "",
                SMBChange : "",
            };
        this.onEmailChange = this.onEmailChange.bind(this);
        this.onPasswordChange = this.onPasswordChange.bind(this);
        this.onBlockChange = this.onBlockChange.bind(this);
        this.onInverterChange = this.onInverterChange.bind(this);
        this.onSMBChange = this.onSMBChange.bind(this);
        // this.onSubmitClicked = this.onSubmitClicked.bind(this);
    }

    pr = {
        cycle : "",
        select : "",
        startDate : "",
    };

    render() {
        return (
            <div>
                <FinalNav name={this.state.name} pr={this.pr} />
                <form className='hello'>
                    <div className="form-group">
                        <label htmlFor="exampleInputEmail1">Zone Number</label> <br />
                        <input type="number"
                               name="zone"
                               className="form-control"
                               id="exampleInputEmail1"
                               aria-describedby="emailHelp"
                               placeholder="Enter Zone Number"
                               onChange={this.onEmailChange}
                        />
                        <br />
                        <label htmlFor="exampleInputPassword1">Row Number</label><br />
                        <input type="number"
                               name="row"
                               className="form-control"
                               id="exampleInputPassword1"
                               placeholder="Enter Row Number"
                               onChange={this.onPasswordChange}
                        />
                        <br />
                        <label htmlFor="exampleInputPassword1">Block Number</label><br />
                        <input type="number"
                               name="row"
                               className="form-control"
                               id="exampleInputPassword1"
                               placeholder="Enter Row Number"
                               onChange={this.onBlockChange}
                        />
                        <br />
                        <label htmlFor="exampleInputPassword1">Inverter ID</label><br />
                        <input type="number"
                               name="row"
                               className="form-control"
                               id="exampleInputPassword1"
                               placeholder="Enter Row Number"
                               onChange={this.onInverterChange}
                        />
                        <br />
                        <label htmlFor="exampleInputPassword1">SMB ID</label><br />
                        <input type="number"
                               name="row"
                               className="form-control"
                               id="exampleInputPassword1"
                               placeholder="Enter Row Number"
                               onChange={this.onSMBChange}
                        />
                        <br />
                        <Link className="btn btn-success button" to="/rowstats">Get the status</Link>
                    </div>
                </form>
            </div>
        );
    }

    onEmailChange(event) {
        this.setState(
            {UsernameChange : event.target.value},
        );
    }

    onPasswordChange(event) {
        this.setState(
            {passwordChange : event.target.value},
        );
    }

    // onSubmitClicked = () => {
    //     // fetch('http://localhost:3000/signin',
    //     //     {
    //     //         method: "post",
    //     //         headers :{
    //     //             "Content-Type" : 'application/json',
    //     //         },
    //     //         body: JSON.stringify({
    //     //             username : this.state.UsernameChange,
    //     //             password : this.state.passwordChange
    //     //         })
    //     //     })
    //     //     .then(resp => resp.json())
    //     //     .then(data => {
    //     //         if(data['status'] === 'success')
    //     //             {
    //     //                 this.props.onRouteChange();
    //     //             }
    //     // });
    //
    // }
    onBlockChange(event) {
        this.setState(
            {BlockChange : event.target.value},
        );
    }

    onInverterChange(event) {
        this.setState(
            {InverterChange : event.target.value},
        );
    }

    onSMBChange(event) {
        this.setState(
            {SMBChange : event.target.value},
        );
    }
}

export default RowEnquiry;


